--Para permitir la visualización de texto en un bloque PL/SQL utilizando DBMS_OUTPUT.PUT_LINE
WHENEVER SQLERROR EXIT SQL.SQLCODE;
SET SERVEROUTPUT ON;
SET DEFINE OFF;

DECLARE

  ERR_NUM NUMBER;-- Numero de errores
  ERR_MSG VARCHAR2(2048);-- Mensaje de error
  V_EXISTE NUMBER(2);

BEGIN
    
    DBMS_OUTPUT.PUT_LINE('[INICIO] Reasignación de gestores.');

    EXECUTE IMMEDIATE 'SELECT COUNT(1) FROM ALL_TABLES WHERE TABLE_NAME = ''MIG2_GEO_GESTORES_OFERTAS_REP'' AND OWNER = ''REM01''' INTO V_EXISTE;
    IF V_EXISTE = 1 THEN


    DBMS_OUTPUT.PUT_LINE('[FIN] Tabla MIG2_GEO_GESTORES_OFERTAS_REP rellena.');

    EXECUTE IMMEDIATE 'MERGE INTO REM01.GEE_GESTOR_ENTIDAD T1
	USING (SELECT ECO.ECO_ID, USU.USU_ID, TGE.DD_TGE_ID, GEE.GEE_ID, MIG.GEO_TIPO_GESTOR
	    FROM MIG2_GEO_GESTORES_OFERTAS_REP MIG
	    JOIN OFR_OFERTAS OFR ON OFR.OFR_NUM_OFERTA = MIG.GEO_COD_OFERTA
	    JOIN ECO_EXPEDIENTE_COMERCIAL ECO ON ECO.OFR_ID = OFR.OFR_ID
	    JOIN REMMASTER.DD_TGE_TIPO_GESTOR TGE ON TGE.DD_TGE_CODIGO = MIG.GEO_TIPO_GESTOR
	    JOIN REMMASTER.USU_USUARIOS USU ON USU.USU_USERNAME = MIG.GEO_GESTOR_ACTIVO
	    LEFT JOIN REM01.GCO_GESTOR_ADD_ECO GCO ON GCO.ECO_ID = ECO.ECO_ID
	    LEFT JOIN REM01.GEE_GESTOR_ENTIDAD GEE ON GEE.GEE_ID = GCO.GEE_ID AND GEE.DD_TGE_ID = TGE.DD_TGE_ID) T2
	ON (T1.GEE_ID = T2.GEE_ID)
	WHEN MATCHED THEN UPDATE SET
	    T1.USU_ID = T2.USU_ID, T1.USUARIOMODIFICAR = ''HREOS-3296'', T1.FECHAMODIFICAR = SYSDATE
	WHERE T1.USUARIOCREAR <> ''HREOS-3296''
	WHEN NOT MATCHED THEN INSERT (GEE_ID, USU_ID, DD_TGE_ID, USUARIOCREAR, FECHACREAR, USUARIOMODIFICAR)
    VALUES (REM01.S_GEE_GESTOR_ENTIDAD.NEXTVAL, T2.USU_ID, T2.DD_TGE_ID, ''HREOS-3296'', SYSDATE, T2.ECO_ID)';
	DBMS_OUTPUT.PUT_LINE(SQL%ROWCOUNT||' filas fusionadas en GEE_GESTOR_ENTIDAD');

	EXECUTE IMMEDIATE 'INSERT INTO REM01.GCO_GESTOR_ADD_ECO (GEE_ID, ECO_ID)
	SELECT GEE_ID, TO_NUMBER(USUARIOMODIFICAR)
	FROM REM01.GEE_GESTOR_ENTIDAD GEE
	WHERE USUARIOCREAR = ''HREOS-3296'' 
	    AND NOT EXISTS (SELECT 1 FROM REM01.GCO_GESTOR_ADD_ECO AUX WHERE GEE.GEE_ID = AUX.GEE_ID)';
	DBMS_OUTPUT.PUT_LINE(SQL%ROWCOUNT||' filas insertadas en GCO_GESTOR_ADD_ECO');
	    
	EXECUTE IMMEDIATE 'MERGE INTO REM01.GEH_GESTOR_ENTIDAD_HIST T1
	USING (SELECT ECO.ECO_ID, USU.USU_ID, TGE.DD_TGE_CODIGO, GEH.GEH_ID
	    FROM MIG2_GEO_GESTORES_OFERTAS_REP MIG
	    JOIN OFR_OFERTAS OFR ON OFR.OFR_NUM_OFERTA = MIG.GEO_COD_OFERTA
	    JOIN ECO_EXPEDIENTE_COMERCIAL ECO ON ECO.OFR_ID = OFR.OFR_ID
	    JOIN REMMASTER.DD_TGE_TIPO_GESTOR TGE ON TGE.DD_TGE_CODIGO = MIG.GEO_TIPO_GESTOR
	    JOIN REMMASTER.USU_USUARIOS USU ON USU.USU_USERNAME = MIG.GEO_GESTOR_ACTIVO
	    LEFT JOIN REM01.GCH_GESTOR_ECO_HISTORICO GCH ON GCH.ECO_ID = ECO.ECO_ID
	    LEFT JOIN REM01.GEH_GESTOR_ENTIDAD_HIST GEH ON GEH.GEH_ID = GCH.GEH_ID AND GEH.DD_TGE_ID = TGE.DD_TGE_ID) T2
	ON (T1.GEH_ID = T2.GEH_ID)
	WHEN MATCHED THEN UPDATE SET
	    T1.GEH_FECHA_HASTA = SYSDATE, T1.USUARIOMODIFICAR = ''HREOS-3296'', T1.FECHAMODIFICAR = SYSDATE
	WHERE T1.USUARIOCREAR <> ''HREOS-3296''';
	DBMS_OUTPUT.PUT_LINE(SQL%ROWCOUNT||' filas actualizadas en GEH_GESTOR_ENTIDAD_HIST');

	EXECUTE IMMEDIATE 'INSERT INTO REM01.GEH_GESTOR_ENTIDAD_HIST (GEH_ID, USU_ID, DD_TGE_ID, GEH_FECHA_DESDE, USUARIOCREAR, USUARIOMODIFICAR, FECHACREAR)
	SELECT REM01.S_GEH_GESTOR_ENTIDAD_HIST.NEXTVAL, USU.USU_ID, TGE.DD_TGE_ID, SYSDATE, ''HREOS-3296'', ECO.ECO_ID, SYSDATE
	FROM MIG2_GEO_GESTORES_OFERTAS_REP MIG
	JOIN OFR_OFERTAS OFR ON OFR.OFR_NUM_OFERTA = MIG.GEO_COD_OFERTA
	JOIN ECO_EXPEDIENTE_COMERCIAL ECO ON ECO.OFR_ID = OFR.OFR_ID
	JOIN REMMASTER.DD_TGE_TIPO_GESTOR TGE ON TGE.DD_TGE_CODIGO = MIG.GEO_TIPO_GESTOR
	JOIN REMMASTER.USU_USUARIOS USU ON USU.USU_USERNAME = MIG.GEO_GESTOR_ACTIVO
	WHERE NOT EXISTS (SELECT 1
	    FROM REM01.GCH_GESTOR_ECO_HISTORICO GCH
	    LEFT JOIN REM01.GEH_GESTOR_ENTIDAD_HIST GEH ON GEH.GEH_ID = GCH.GEH_ID AND GEH.GEH_FECHA_HASTA IS NULL
	    WHERE GCH.ECO_ID = ECO.ECO_ID AND GEH.DD_TGE_ID = TGE.DD_TGE_ID)';
	DBMS_OUTPUT.PUT_LINE(SQL%ROWCOUNT||' filas insertadas en GEH_GESTOR_ENTIDAD_HIST');

	EXECUTE IMMEDIATE 'INSERT INTO rem01.GCH_GESTOR_ECO_HISTORICO (GEh_ID, ECO_ID)
	SELECT GEh_ID, TO_NUMBER(USUARIOMODIFICAR)
	FROM REM01.GEh_GESTOR_ENTIDAD_hist GEh
	WHERE USUARIOCREAR = ''HREOS-3296'' 
	    AND NOT EXISTS (SELECT 1 FROM REM01.GCh_GESTOR_ECO_historico AUX WHERE GEh.GEh_ID = AUX.GEh_ID)';
	DBMS_OUTPUT.PUT_LINE(SQL%ROWCOUNT||' filas insertadas en GCH_GESTOR_ECO_HISTORICO');
	ELSE
		DBMS_OUTPUT.PUT_LINE('No existe la tabla auxiliar MIG2_GEO_GESTORES_OFERTAS_REP.');
	END IF;

    COMMIT;

EXCEPTION
    WHEN OTHERS THEN
      DBMS_OUTPUT.PUT_LINE('[ERROR] Se ha producido un error en la ejecución:'||TO_CHAR(SQLCODE));
      DBMS_OUTPUT.PUT_LINE('-----------------------------------------------------------');
      DBMS_OUTPUT.PUT_LINE(SQLERRM);
      ROLLBACK;
      RAISE;
END;
/
EXIT